import {Route, Redirect} from 'react-router-dom';

export default function RouterWrapper({
  component: Component, 
  isPrivate,
  ...rest
}){

  const loading = false;
  const signed = false;

  if(loading){
    return(
      <div>
        <h1>Carrengando...</h1>
      </div>
    )
  }

  // Verificando se o usu치rio esta logado no sistema e retornando a tela de login.
  if(!signed && isPrivate){
    return <Redirect to="/"/>
  }

  //Verificando se est치 logado e retornando a tela de painel.
  if(signed && !isPrivate){
    return <Redirect to="/dashboard" />
  }

  return( 
    <Route 
      {...rest}
      render={props => (
        <Component {...props}/>
      )}
    />
  )
}
